import React from 'react';
import { useNavigate } from 'react-router-dom';

function PaymentMethodSelection() {
  const navigate = useNavigate();

  const handlePaymentSelection = (method) => {
    if (method === 'Fawry') {
      navigate('/fawry');
    } else if (method === 'Digital Wallet') {
      navigate('/digital-wallet');
    } else if (method === 'Credit Card') {
      navigate('/credit-card');
    }
  };

  return (
    <div>
      <h2>Select Payment Method</h2>
      <button onClick={() => handlePaymentSelection('Fawry')}>Fawry</button>
      <button onClick={() => handlePaymentSelection('Digital Wallet')}>Digital Wallet</button>
      <button onClick={() => handlePaymentSelection('Credit Card')}>Credit Card</button>
    </div>
  );
}

export default PaymentMethodSelection;
